import {Route, Routes, BrowserRouter, Navigate} from "react-router-dom";
import React, {useState} from "react";
import {CART_ROUTE, SHOP_ROUTE} from "./consts";
import Shop from "./pages/shop";
import Cart from "./pages/cart";
import {CartDishesContext} from "./components/cartDishesContext";

function App() {
  const [cartDishes, setCartDishes] = useState([]);

  return(
    <CartDishesContext.Provider value={{
      cartDishes, setCartDishes
    }}>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Shop/>} exact/>
          <Route path={CART_ROUTE} element={<Cart/>}/>

        </Routes>
      </BrowserRouter>
    </CartDishesContext.Provider>
  );
}

export default App;
